import './StatsTitle.css';

const StatsTitle: React.FC = () => {
  return (
    <div className="stats-title-container">
      <h2 className="stats-title-text">
        We <span className="highlight-golden">clarify</span> your brand messaging and help you <span className="highlight-golden">reach the right audience</span>
      </h2>
    </div>
  );
};

export default StatsTitle;
